import React from "react";
import "./Header.scss";
import {Link} from 'react-router-dom'

const Header = (props) => {
  //debugger


  return (
    <header className="header">
      <Navigation  />
    </header>
  );
};

const Navigation = (props) => {
  return (
      <section className="top-nav">
      <div className="top-nav-logo-name">
        <img src={require('../../assets/img/nav-logo.png')} alt="" className="top-nav-logo" />
        <div className="top-nav-name">Xtal Ball Enterprise</div>
      </div>
      <input id="menu-toggle" type="checkbox" />
      <label className='menu-button-container' for="menu-toggle">
      <div className='menu-button'></div>
    </label>
      <ul className="menu">
        <li>Homepage</li>
        <li>Create your generator</li>
        <li>About Us</li>
        <li>Next...</li>
      </ul>
    </section>
  )
}

const HelloHeader = (props) => {
  return (
  <div class="hero-step2">
      <div class="hero-step2__circle"><img class="hero-step2__circle-img" src="img/type1_200px.png" alt="xtall" /></div>
      <div class="hero-step2__circle"><img class="hero-step2__circle-img" src="img/type2_200px.png" alt="xtall" /></div>
      <div class="hero-step2__circle"><img class="hero-step2__circle-img" src="img/type3_200px.png" alt="xtall" /></div>

      <div class="hero-step2__circle"><img class="hero-step2__circle-img" src="img/type4_200px.png" alt="xtall" /></div>
      <div class="hero-step2__circle"><img class="hero-step2__circle-img" src="img/type5_200px.png" alt="xtall" /></div>

  </div>
  )
}

export default Header;
